$templateCache.put('build/templates/ip/system/s1-visitor-privacy.htm','<div class="privacy container">\r\n  <h1>Privacy Policy</h1>\r\n  <p>\r\n    This privacy policy discloses the privacy practices for {{agent.webDomain}} and InHouse (We). This privacy policy applies solely to information collected by this Web site. It will notify you of the following:\r\n  </p>\r\n  <ol>\r\n    <li>What personally identifiable information is collected from you through the Web site, how it is used and with whom it may be shared.</li>\r\n    <li>What choices are available to you regarding the use of your data.</li>\r\n    <li>The security procedures in place to protect the misuse of your information.</li>\r\n    <li>How you can correct any inaccuracies in the information.</li>\r\n  </ol>\r\n  <h2>Information Collection, Use, and Sharing</h2>\r\n  <p>\r\n    We are the sole owners of the information collected on this site. We only have access to/collect information that you voluntarily give us via email or other direct contact from you. We will not sell or rent this information to anyone.\r\n  </p>\r\n  <p>\r\n    We will use your information to respond to you, regarding the reason you contacted us. We will not share your information with any third party outside of our organization, other than as necessary to fulfill your request, e.g. request mortgage information or any real estate related request.\r\n  </p>\r\n  <p>\r\n    Unless you ask us not to, We may contact you via email or phone in the future regarding your real estate needs, to tell you about new products or services, or inform you of changes to this privacy policy.\r\n  </p>\r\n  <h2>Your Access to and Control Over Information </h2>\r\n  <p>\r\n    You may opt out of any future contacts from us at any time. You can do the following at any time by contacting us via the email address or phone number given on our Website:\r\n  </p>\r\n  <ul>\r\n    <li>See what data We have about you, if any.</li>\r\n    <li>Change/correct any data We have about you.</li>\r\n    <li>Have us delete any data We have about you.</li>\r\n    <li>Express any concern you have about our use of your data.</li>\r\n  </ul>\r\n  <h2>Updates</h2>\r\n  <p>Our Privacy Policy may change from time to time and all updates will be posted on this page.</p>\r\n  <h2>Registration </h2>\r\n  <p>In order to use this Website, a user must first complete the registration form. During registration a user is required to give certain information (such as name, email address, and phone number). This information is used to contact you about the products/services on our site in which you have expressed interest.</p>\r\n  <h2>Cookies </h2>\r\n  <p>We use "cookies" on this site. A cookie is a piece of data stored on a site visitor\'s hard drive to help us improve your access to our site and identify repeat visitors to our site. For instance, when We use a cookie to identify you, you would not have to log in a password more than once, thereby saving time while on our site. Cookies can also enable us to track and target the interests of our users to enhance the experience on our site.</p>\r\n  <h2>Links</h2>\r\n  <p>\r\n    This Web site contains links to other sites. Please be aware that We are not responsible for the content or privacy practices of such other sites. We encourage our users to be aware when they leave our site and to read the privacy statements of any other site that collects personally identifiable information.\r\n  </p>\r\n  <p>If you feel that We are not abiding by this privacy policy, you should contact us immediately via telephone at {{agent.agentPhone}} or via email at {{agent.agentEmail}}.</p>\r\n</div>');
